import axios from 'axios';
import { useState } from 'react';

export default function Main(){
    const [name,setLname] = useState('')
    const [address,setAddress] = useState('')

    const handlesubmit = async() =>{
        const res = await axios.post('http://127.0.0.1:8000/labs/',{name,address})
        console.log(res.data)
    }


    const func = async () => {
        const res = await axios.get('http://127.0.0.1:8000/labs/')
        console.log(res.data)
    }
    return (
        <div>
        <h1>Know Your Health</h1>


        <input type='text' placeholder='Lab Name'  onChange={(e)=>setLname(e.target.value)}/><br/>
        <input type='text' placeholder='Address'  value={address} onChange={(e)=>setAddress(e.target.value)} /> <br/>
        <button onClick={handlesubmit}>click</button>
        </div>
    )
}
